import React from "react";
import {AppBar, Container, Grid, Paper, Tab, Tabs, Typography} from "@material-ui/core";
import SwipeableViews from 'react-swipeable-views';
interface TabPanelProps {
    children?: React.ReactNode;
    dir?: string;
    index: any;
    value: any;
}
import './Default.scss';

export function Product() {
    return (
        <div className='products-wrap'>
            <div className='hero-area'>
                <Container>
                    1
                </Container>
            </div>
            <div className='icon-area'>
                <Container>
                    <Typography variant="h5" align="center">Welcome to DV ONLINE Banking</Typography>
                    <Grid container spacing={3}>
                        <Grid item xs>
                            <Paper>xs</Paper>
                        </Grid>
                        <Grid item xs>
                            <Paper>xs</Paper>
                        </Grid>
                        <Grid item xs>
                            <Paper>xs</Paper>
                        </Grid>
                    </Grid>
                </Container>
            </div>
            <div className='benefit-area'>
                <Container>
                    3
                </Container>
            </div>
            <div className='products-area'>
                <Container>

                </Container>
            </div>
            <div className='volunteer-area'>
                <Container>

                </Container>
            </div>
        </div>
    );
}

export function Event() {
    const [value, setValue] = React.useState(0);
    const handleChange = (event: React.ChangeEvent<{}>, newValue: number) => {
        setValue(newValue);
    };
    const handleChangeIndex = (index: number) => {
        setValue(index);
    };
    return (
        <Container component="main" maxWidth='lg' className='event-wrap'>
            <AppBar position="static" color="default">
                <Tabs
                    value={value}
                    onChange={handleChange}
                    indicatorColor="primary"
                    textColor="primary"
                    variant="fullWidth"
                    aria-label="full width tabs example"
                >
                    <Tab label="Item One"/>
                    <Tab label="Item Two"/>
                    <Tab label="Item Three"/>
                </Tabs>
            </AppBar>
            <SwipeableViews
                axis={theme.direction === 'rtl' ? 'x-reverse' : 'x'}
                index={value}
                onChangeIndex={handleChangeIndex}
            >
                <TabPanel value={value} index={0} dir={theme.direction}>
                    Item One
                </TabPanel>
                <TabPanel value={value} index={1} dir={theme.direction}>
                    Item Two
                </TabPanel>
                <TabPanel value={value} index={2} dir={theme.direction}>
                    Item Three
                </TabPanel>
            </SwipeableViews>

        </Container>
    );
}

export function FAQ() {
    return (
        <div className='faq-wrap'>
            <div className='hero-area'>
                <Container>
                    1
                </Container>
            </div>
        </div>
    );
}

function TabPanel(props: TabPanelProps) {
    const { children, value, index, ...other } = props;

    return (
        <Typography
            component="div"
            role="tabpanel"
            hidden={value !== index}
            id={`full-width-tabpanel-${index}`}
            aria-labelledby={`full-width-tab-${index}`}
            {...other}
        >
            {value === index && <Box p={3}>{children}</Box>}
        </Typography>
    );
}
